import $ from "jquery"

exports.postData = postData(url, data);

async function postData(url = '', data = {}) {
    let response = await $.ajax({
        type: "POST",
        url: url,
        data: data,
    })
    return response.json();
}

exports.getData = async function (url = '', data = {}) {
}
